import React, { Component } from 'react'
import Navbar from './components/Navbar'
import News from './components/news'
import './App.css'
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

export class App extends Component {
  render() {

    return (
      <>
      <Router>
      <Navbar />
      <Switch>
          <Route exact path="/"><News key="" pageSize={12} category="general" country="in"/></Route>
          <Route exact path="/business"><News pageSize={12} category="business" country="in"/></Route>
          <Route exact path="/entertainemnt"><News pageSize={12} category="entertainemnt" country="in"/></Route>
          <Route exact path="/health"><News pageSize={12} category="health" country="in"/></Route>
          <Route exact path="/science"><News pageSize={12} category="science" country="in"/></Route>
          <Route exact path="/technology"><News pageSize={12} category="technology" country="in"/></Route>
          <Route exact path="/sports"><News pageSize={12} category="sports" country="in"/></Route>
      </Switch>
      </Router>
      </>
    )
  }
}

export default App
